// External memory arbiter config 1
//
// The read/write client priority masks are used to mask the read/write winner client
// priority vector before comparison. The priority vector is made of the following fields:
//   - the 3 most-significant bits of the priority vector from arbitration
//   - whether this winner is in the same page
//   - a bit indicating whether the read/write window has expired
//   Which are computed into:
//      priwin = {hp ? 3'h7 : ({timeout,bw}+fpri[1:0])}
//      privec = {priwin[2:1], spwin, priwin[0], winexpire}
//   for the purposes of this mask.
// The lowest significant bit is controlled by the EMEM_WRSWITCH_WWINEXPIRED and
// EMEM_RWSWITCH_RWINEXPIRED fields described below.
//
// The no-read/write (write/read) switch on bank-blocked requests fields are used
// to allow/disallow read/write switching when there are requests of the current window
// type blocked by the bank counters.
//
// The read/write switch is used to make the arbiter switch from reads to writes
// once the read window has expired and there are read and write requests with equal
// priority. Otherwise the arbiter would stick with reads as it is better for dram
// bandwidth utilization. Switching is usually the desired behavior.
//
// The write/read switch is used to make the arbiter switch from writes to reads
// once the write window has expired and there are read and write requests with equal
// priority. Otherwise the arbiter would stick with writes as it is better for dram
// bandwidth utilization. Switching is usually the desired behavior.
//
// Same-Page consecutive transactions maximum count limits, when bank-contention
// is detected among two or more clients, the maximum number of
// consecutive same-page-based wins the arbiter will grant to the same client
// before masking that client's same-page indication for one arbitration cycle.
//   Value of 0 disables.
//   Value of 16 approximates (in certain situations) the behavior of earlier 
//       architectures where bank==adr[7:6].
// 
// Same-page consecutive transactions maximum count for read/write arbiter limits 
// the maximum number of consecutive same-page-based wins the r/w arbiter will grant 
// after the r/w window has expired before masking the expired window's spwin bit
// from the r/w arbiter priority vector.
//   Value of 0 disables.
//
// Boot requirements: This arbitration configuration register should be parameterized in the BCT and written by the OS during coldboot and warmboot.

