// OPEN ISSUES 2006/01/24:
//    - should we have a filter based on EMC bank number?
//    - currently LATENCY_AVG and LATENCY_HISTO are both qualified only
//      by CLIENT_ID.  Should we allow other filters, especially the
//      high/low priority one?
//    - separate wide requests from coalesced requests?  worth it?
//      but aren't wide requesters known by their CLIENT_ID?
//    - the registers for IMC/EMC get interleaved in a less than
//      friendly way for software, but fixing it either requires
//      declaring all the registers together in one macro, or writing
//      everything out explicitly.
//
// The purpose of the statistics collection feature is to allow empirical
// measurement of client and memory system bandwidth and latency so that
// system performance can be analyzed and tuned.  It may also be useful
// for debugging problems in case of design or silicon errors.
//
// Data can be collected to provide information such as the # transfers/sec
// in the memory system or in for a given client; the percentage of total
// bandwidth used by a given client; the percentage of requests that are
// high priority, and much more.  It can also be used to measure latency
// of a single client.
//
// NOTE: The statistics register documentation is common for both 
//       internal (IMC) and external (EMC) memory apertures. The
//       statistics registers associated with the apertures are only
//       available if the aperture is available for a particular chip, 
//       regardless of the mentions in the documentation.
//
// First, the cast of characters.  Registers marked "rw" are read/write
// and control behavior; they hold static values.  Registers marked "r"
// are read only and are updated by hardware during data collection.
//
//    Common:
//        rw STAT_CONTROL
//        r  STAT_STATUS
//
//    Per memory controller (IMC or EMC):
//        rw STAT_?MC_ADDR_LOW
//        rw STAT_?MC_ADDR_HIGH
//        rw STAT_?MC_CLOCK_LIMIT
//        r  STAT_?MC_CLOCKS
//        "N" event counter sets:
//            rw STAT_?MC_CONTROL[0..N-1]
//            rw STAT_?MC_HIST_LIMIT[0..N-1]
//            r  STAT_?MC_COUNT[0..N-1]
//            r  STAT_?MC_HIST[0..N-1]
//
// These registers will be outlined here, but are definitively described
// in the comment block preceding each register declaration later.
//
// The IMC and EMC have identical statistics gathering blocks; both are
// controlled by a common control register, STAT_CONTROL,  so that data
// gathering of information that spans those two interfaces can be
// absolutely correlated.  Status can be read back in the STAT_STATUS
// register.  Each memory controller has one set of address range filters
// (STAT_?MC_ADDR_LOW and STAT_?MC_ADDR_HIGH), one register counting the
// number of cycles that data collection was active for that memory
// controller (STAT_?MC_CLOCKS), and one register to limit the number
// of clock cycles of data collection (STAT_?MC_CLOCK_LIMIT).
//
// Each of the memory controllers has a number of sets of event counters.
// One set consists of two control registers(STAT_?MC_CONTROL[n] and
// STAT_?MC_HIST_LIMIT[n]), and two counters (STAT_?MC_COUNT[n] and
// STAT_?MC_HIST[n]).
//
// All of the functionality lives in the MC clock domain.  Latencies that
// are measured are from/to the client interface on the MC side, not on
// the client side.  What this means to the programmer is that the numbers
// reported by the block are less than the latencies experienced by the
// unit selected by the CLIENT_ID (described later) -- in fact, there may
// be another 20 or more cycles of latency not included in the reported
// number.  Although it would be nice, reporting the latency experienced
// at the client side is simply too expensive.
//
// Below, "?MC" is a shorthand to mean that the thing being discussed
// applies to both IMC and EMC statistics units.
//
// COLLECTING STATISTICS:
//
// Before diving into the details, here is a sketch of how the block would be
// used to collect some statistics.  The most common scenario is as follows.
//
//    1) Set STAT_CONTROL.?MC_GATHER to DISABLE.
//
//    2) STAT_?MC_CLOCK_LIMIT, STAT_?MC_CONTROL[n], and perhaps the
//       STAT_?MC_HIST_LIMIT[n] and STAT_?_MC_ADDR_{HIGH,LOW} registers
//       are programmed to select the desired data collection mode.
//
//    3) If STAT_?MC_CONTROL[n] is set to measure latency,
//       STAT_CONTROL.?MC_GATHER must be changed to RST until the memory
//       client associated with the CLIENT_ID is idle.  If latency isn't
//       being measured, then CLIENT_ID can be changed without regard to
//       the client's activity.
//
//    4) STAT_CONTROL.?MC_GATHER is set to CLEAR to zero all counts.
//
//    5) Software gets up a usage case running on the system.
//
//    6) STAT_CONTROL.?MC_GATHER are both set to ENABLE.
//
//    7) Time passes.  Software can freely change the state of
//       STAT_CONTROL.?MC_GATHER between DISABLE and ENABLE; counters
//       advance only during the ENABLE state.  The counters can be
//       read at any time, but they change constantly.
//
//    8) STAT_CONTROL.?MC_GATHER are both set to DISABLE.
//
//    9) Software reads out STAT_?MC_CLOCKS, STAT_?MC_COUNT[n], and
//       STAT_?MC_HIST[n] counters and calculates whatever it was trying
//       to measure.
//
//   10) Software may go back to step 2 to gather a different type of
//       statistic; or it may go back to step 4 to measure the same
//       quantity again.  Legal but less likely, software can go back
//       to step 6 to continue collecting data without resetting the
//       counters, allowing a cumulative reading.
//
// All counters are 32 bits wide.  Most events that are tallied don't happen
// every cycle, but in the limit, an event that triggered every clock cycle
// would take more than 20 seconds at 200 MHz before saturating.  The one
// exception is that in latency mode, an event counter gets incremented by
// the number of outstanding requests for a chosen client on every cycle.
// The number of outstanding requests is implementation dependent, but
// assuming an case where 64 requests were outstanding at most times, a 32b
// counter would saturate after about 335 ms.  Software should take this
// into account when selecting the intervals on which to sample.
// STAT_CONTROL is the common control register for enabling/disabling the
// statistics collection for both IMC and EMC stats blocks.  STAT_CONTROL
// is the master switch that clears counter state, enables and disables all
// statistics collection for the memory controllers.
//
// The ?MC_GATHER bits are master control bits to turn collection on and off.
// Typically IMC_GATHER and EMC_GATHER will both be written to the same
// value but it is not necessary.
//
// In general, the stats controls can be enabled/disabled at will.  However,
// the CLIENT_ID field in either the IMC or EMC blocks should be changed only
// when the corresponding client has no outstanding memory requests,
// otherwise any latency statistics collected will be meaningless.  This
// requirement could be onerous to meet for the display controller, which is
// running continuously; the only solution is that unit must be disabled to
// set up latency measurements on it since it isn't possible to wait for it
// to go idle.
//
// The RST state for ?MC_GATHER zeros out any counters associated with the
// corresponding IMC/EMC.  It also has the effect of clearing some internal
// state that must be reset any time the CLIENT_ID field is changed before
// taking a latency measurement.  RST should be exited only when the unit
// associated with the CLIENT_ID has no outstanding memory requests.  This
// requirement is relevant only when measuring latency and can be ignored
// for bandwidth measurements (but if is ignored in this case, it must
// later be met when switching back into latency measurement mode).  Once
// entered, ?MC_GATHER stays in the RST state until software changes it.
//
// The CLEAR state for ?MC_GATHER is similar to RST in that it zeros out
// any counters associated with the corresponding IMC/EMC.  As long as the
// CLIENT_ID hasn't changed, there is no need to enter RST, and CLEAR
// should be used instead (there is nothing wrong with using RST to zero
// the counters; it is just that much more care must be taken in exiting the
// RST state that CLEAR is preferable).  Software an enter and exit the
// CLEAR state at will.  The CLEAR state persists until ?MC_GATHER is
// changed under software control.
//
// The DISABLE state causes all statistics counters of a memory controller
// to freeze at their current value.  If the GATHER state goes back to
// ENABLE, the counters keep incrementing from their previous value.
//
// The ENABLE state is when the statistics counters increment according
// to whatever activity was selected by their STAT_?MC_CONTROL register.
// The counting activity is conditional on the LIMIT condition, described
// in the STAT_STATUS register.

// Register MC_STAT_CONTROL_0  
#define MC_STAT_CONTROL_0                       _MK_ADDR_CONST(0x90)
#define MC_STAT_CONTROL_0_SECURE                        0x0
#define MC_STAT_CONTROL_0_WORD_COUNT                    0x1
#define MC_STAT_CONTROL_0_RESET_VAL                     _MK_MASK_CONST(0x0)
#define MC_STAT_CONTROL_0_RESET_MASK                    _MK_MASK_CONST(0x300)
