// This controls what the associated STAT_?MC_COUNT_0 and STAT_?MC_HIST_0
// are counting.  The MODE field controls whether statistics are collected on
// bandwidth or latency.  The three MODEs of operation are:
//
//    BANDWIDTH
//
//        This mode is really more general than just measuring bandwidth.
//        It counts the number of times a selected event occurs; if that
//        event is a memory transfer, then it is easily turned into a
//        bandwidth figure.  This mode is useful for doing any type of
//        ratio'd comparison (e.g., words/second, % high priority requests).
//
//        CLIENT_ID can be used to qualify which client is being monitored.
//        This field can also be ignored (see FILTER_CLIENT).
//
//        EVENT choses what the counter is counting.
//        All EVENTS are  qualified by all FILTER_* controls, since
//        each filter can be independently disabled.
//        The choices are:
//
//            QUALIFIED:
//                An event is generated when the chosen client makes a
//                request that satisfies all the qualifiers.
//
//            ANY_READ:
//                An event is generated when the memory controller sees
//                a read request from any client.
//
//            ANY_WRITE:
//                An event is generated when the memory controller sees
//                a write request from an client.
//
//            RD_WR_CHANGE:
//                An event is generated when the memory controller switches
//                between making a read request to making a write request.
//
//            SUCCESSIVE:
//                An even generated when the chosen client has wins arbitration
//                when it was also the winner at the previous request.  If a
//                client makes N requests in a row that are honored, SUCCESSIVE
//                will be counted (N-1) times.  Large values for this event
//                imply that if we were patient enough, all of those requests
//                could have been coalesced.
//            PAGE_MISS:
//                An event is generated when the memory controller detects
//                a page miss for the current request.  This can be used to
//                compute the hit rate.  This event is relevant for the EMC
//                only.
//                NOTE: Because the MC does not decode the address into
//                {device,row,bank,column}, the stats block assumes bankwidth==2, 
//                colwidth==8, and devsize==128MB, so that the bank address is 
//                adr[RI3:RI2] and the row address is adr[ROW_WIDTH+RI3:RI3+1].
//
//            AUTO_PRECHARGE:
//                An event is generated when the request to the EMC is marked
//                as requesting an auto precharge (telling the memory
//                controller to assume the next request will be for a different
//                page than the present request).  This event is relevant for
//                the EMC only.
//
//        PRI_EVENT choses what the priority filter is filtering.  The choices are:
//
//            HP:
//                An event is generated based on the high-priority (HP) signal
//                accompanying a request for arbitration. This is qualified by
//                FILTER_PRI, so that YES is associated with HIGH priority.
//            TM:
//                An event is generated based on the timeout (TM) signal
//                accompanying a request for arbitration. This is qualified by
//                FILTER_PRI, so that YES is associated with tm being set.
//            BW:
//                An event is generated based on the bandwidth (BW) signal
//                accompanying a request for arbitration. This is qualified by
//                FILTER_PRI, so that YES is associated with bw being set.
//
//        FILTER_* qualify what the EVENT field selected.  Not all filters
//        apply to all events, as noted above.
//
//            FILTER_CLIENT:
//                When enabled, a request will be ignored unless the
//                request came from the client matching CLIENT_ID.
//
//            FILTER_ADDR:
//                When enabled, a request will be ignored unless the address
//                falls in the range selected by STAT_?MC_ADDR_{LOW,HIGH}.
//
//            FILTER_PRI:
//                When not disabled, a request will be ignored unless the
//                requester is matching the PRI_EVENT.
//
//            FILTER_COALESCED:
//                When not disabled, a request will be ignored unless the
//                request was/was not part of a coalesced transfer pair,
//                as specified.  The count increments for each of the two
//                beats of the transfer.
//
//    LATENCY_AVG
//        This mode is used to measure the average latency for a single
//        client.  The latency is measured from when the MC clock domain
//        side of the client makes a request until data is returned to that
//        client on reads, or until write acknowledgment is received on
//        writes.  It does not include any synchronization latency nor any
//        latency in the part of the client in the client's clock domain.
//
//        The client chosen by CLIENT_ID is monitored and a count is always
//        kept of the number of outstanding requests, even when data isn't
//        being collected.  Any time the CLIENT_ID is changed in this mode,
//        or any time this mode is entered, the STAT_CONTROL.?MC_GATHER
//        control must be set to RST until the chosen client is idle, and
//        it must briefly enter that state even if the client is already
//        idle.  RST is different than CLEAR in that RST is what zeros
//        out the count of the number of outstanding client transfers.
//
//        While STAT_CONTROL.?MC_GATHER is ENABLEd, the count of the number
//        of outstanding requests is added to STAT_?MC_HIST[n], and each
//        request by the client increments STAT_?MC_COUNT[n].
//
//        At the end of the data collection period, dividing STAT_?MC_HIST[n]
//        by STAT_?MC_COUNT[n] yields the average latency.
//
//    LATENCY_HISTO
//        This mode is used to get a finer understanding of the memory
//        latency than just the gross average.  In this mode, the hardware
//        tracks the latency for a single request at a time.  When the ack
//        for that particular request is seen, the STAT_?MC_COUNT[n] register
//        is incremented.  At the same time, if that measured latency falls
//        between the bounds set by STAT_?MC_HIST_LIMIT.{LOW,HIGH},
//        inclusively, STAT_?MC_HIST[n] is incremented too.  The latency
//        measurement hardware is re-armed (dependent on the SKIP field,
//        described below) and continues to collect data on the next request
//        that arrives.
//
//        At the end of the data collection period, dividing STAT_?MC_HIST[n]
//        by STAT_?MC_COUNT[n] yields the fraction of the time that request
//        latency fell within that bucket.  The COUNT is also some indication
//        of how trustworthy the result is.
//
// Because LATENCY_HISTO mode operates by tracking one request through the
// pipeline at a time, there are likely to be other requests that arrive that
// match the CLIENT_ID of the client being monitored, and so some requests
// will be ignored.  There is a danger that the sampling period may align
// with a memory request cycle such that the hardware keeps sampling the same
// request in that cycle of requests.  For bursty clients especially, there
// is a danger of oversampling the first requests of a burst pattern.
// 
// The SKIP field is used in conjunction with the LATENCY_HISTO mode to
// reduce that problem.  Rather than processing the very next request that
// matches the CLIENT_ID, the SKIP control allows skipping a semi-random
// number of qualifying requests before taking another latency measurement.
// SKIP specifies how many LS bits of the STAT_?MC_CLOCKS register to take as
// the number of qualified requests to ignore before rearming the sampling
// hardware in LATENCY_HISTO mode.  A SKIP value of 0 means no requests are
// skipped.

