#define MC_CLIENT_HOTRESETN_DISABLE     1
#define MC_CLIENT_HOTRESETN_ENABLE      0
// Memory Client Hot Reset Register. Active low. Reset value is no hot reset.
// When enabled, the client requests before arbitration are cleared.
// A proper client reset sequence is as followed:
// - Clear client bit in the MC_CLIENT_CTRL register to block its requests.
// - Poll the C_OUTREQCNT register till zero.
// - Clear module bit in the APBDEV_RSTREG register to reset the module,
//   and clear client bit in the MC_CLIENT_HOTRESETN register to clear the client
//   requests sitting before arbitration.
// - Set client bit in the MC_CLIENT_HOTRESETN register to release the hot reset.
// - Set module bit in the APBDEV_RSTREG register to release the module reset.
// - Set client bit in the MC_CLIENT_CTRL register to allow new requests
//   to proceed to arbitration.

